@testset "1.2.3.2 (d x)^m (a+b x^n+c x^(2 n))^p" begin
    @variables a, b, c, d, e, f, m, n, p, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*x^3+c*x^6)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*x^3+c*x^6)^p*with*a=0=#


    @test_int [(a*x^3 + b*x^6)^(5/3), x, 2, -((3*a*(a*x^3 + b*x^6)^(8/3))/(88*b^2*x^8)) + (a*x^3 + b*x^6)^(8/3)/(11*b*x^5)]
    @test_int [(a*x^3 + b*x^6)^(2/3), x, 1, (a*x^3 + b*x^6)^(5/3)/(5*b*x^5)]
    @test_int [1/(a*x^3 + b*x^6)^(2/3), x, 1, -((a*x^3 + b*x^6)^(1/3)/(a*x^2))]
    @test_int [1/(a*x^3 + b*x^6)^(5/3), x, 3, 1/(2*a*x^2*(a*x^3 + b*x^6)^(2/3)) - (3*(a*x^3 + b*x^6)^(1/3))/(4*a^2*x^5) + (9*b*(a*x^3 + b*x^6)^(1/3))/(4*a^3*x^2)]


    @test_int [1/(-x^3 + x^6), x, 8, 1/(2*x^2) - atan((1 + 2*x)/sqrt(3))/sqrt(3) + (1/3)*log(1 - x) - (1/6)*log(1 + x + x^2)]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*x^3+c*x^6)^p*with*b^2-4*a*c=0=#


    #= ::Subsection:: =#
