    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^5*sqrt(a^2 + 2*a*b*x^3 + b^2*x^6), x, 3, (a*x^6*sqrt(a^2 + 2*a*b*x^3 + b^2*x^6))/(6*(a + b*x^3)) + (b*x^9*sqrt(a^2 + 2*a*b*x^3 + b^2*x^6))/(9*(a + b*x^3))]
